// src/components/DashboardTable.js
import React, { useState } from 'react';
import { Button, IconButton, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper } from '@mui/material';
import FiberManualRecordIcon from '@mui/icons-material/FiberManualRecord';
import PictureAsPdfIcon from '@mui/icons-material/PictureAsPdf';
import DescriptionIcon from '@mui/icons-material/Description';

const DashboardTable = ({ students }) => {
  const [claireSubmissions, setClaireSubmissions] = useState([]);
  const [isRecording, setIsRecording] = useState(false);
  const [mediaRecorder, setMediaRecorder] = useState(null);
  const [audioChunks, setAudioChunks] = useState([]);

  const startRecording = () => {
    navigator.mediaDevices.getUserMedia({ audio: true }).then(stream => {
      const recorder = new MediaRecorder(stream);
      setMediaRecorder(recorder);
      
      recorder.ondataavailable = (event) => {
        setAudioChunks((currentChunks) => [...currentChunks, event.data]);
      };

      recorder.onstop = () => {
        const audioBlob = new Blob(audioChunks, { type: 'audio/mpeg' });
        // For this prototype, we'll just create an object URL for the audio
        const audioUrl = URL.createObjectURL(audioBlob);
        // In a real app, you'd send this blob to the server here
        // ...
        // For now, let's just add a placeholder text file to the submissions
        const newSubmission = {
          fileName: 'audio_recording.mp3',
          submittedOn: new Date().toLocaleDateString(),
        };
        setClaireSubmissions([...claireSubmissions, newSubmission]);
      };

      recorder.start();
      setIsRecording(true);
    });
  };

  const stopRecording = () => {
    mediaRecorder.stop();
    setIsRecording(false);
  };

  const toggleRecording = () => {
    if (isRecording) {
      stopRecording();
    } else {
      startRecording();
    }
  };

  // Helper function to get the appropriate icon based on the file type
  const getFileIcon = (fileName) => {
    if (fileName.toLowerCase().endsWith('.pdf')) {
      return <PictureAsPdfIcon />;
    } else if (fileName.toLowerCase().endsWith('.doc') || fileName.toLowerCase().endsWith('.docx')) {
      return <DescriptionIcon />;
    }
    // No icon for audio files in this simple example
  };

  return (
    <TableContainer component={Paper} style={{ width: '100%' }}>
      <Table aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell style={{ width: '10%' }}>Name</TableCell>
            <TableCell align="center" style={{ width: '40%' }}>Submission</TableCell>
            <TableCell align="center" style={{ width: '20%' }}>Grade</TableCell>
            <TableCell align="center" style={{ width: '20%' }}>Comments</TableCell>
            <TableCell align="center" style={{ width: '10%' }}>Record</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {/* Placeholder row for Claire Johnson */}
          <TableRow>
            <TableCell component="th" scope="row">Claire Johnson</TableCell>
            <TableCell align="center">
              {claireSubmissions.map((submission, index) => (
                <div key={index}>
                  {getFileIcon(submission.fileName)}
                  {submission.fileName} submitted on {submission.submittedOn}
                </div>
              ))}
              <Button variant="contained" component="label">
                Upload File
                <input type="file" hidden onChange={handleFileUpload} accept=".pdf,.doc,.docx" />
              </Button>
            </TableCell>
            <TableCell align="center">-</TableCell>
            <TableCell align="center">
              <input type="text" placeholder="Enter comments" />
            </TableCell>
            <TableCell align="center">
              <IconButton color={isRecording ? "secondary" : "default"} onClick={toggleRecording}>
                <FiberManualRecordIcon />
              </IconButton>
            </TableCell>
          </TableRow>
          {/* Rest of the students */}
          {/* ... */}
        </TableBody>
      </Table>
    </TableContainer>
  );
};

export default DashboardTable;
